<?php

namespace App\Services;

use Illuminate\Http\Request;
use Illuminate\Support\Str;

/**
 * Class UtilitarioService
 * @package App\Services
 */
class UtilitarioService
{

    public static function getPrimeiroNome($nome){
        return Str::before($nome, ' ');;
    }

    public static function getSobreNome($nome){
        return Str::afterLast($nome, ' ');;
    }

    public static function getPrimeiroUltimoNome($nome){
        return UtilitarioService::getPrimeiroNome($nome).' '.UtilitarioService::getSobreNome($nome);
    }

    public static function getNameToSelect($dados)
    {
        return $dados->pluck('name', 'id');
    }
























    public static function imageToBase64(Request $request, string $campo)
    {
        if ($request->hasFile($campo) && $request->file($campo)->isValid()) :
            $ext = $request->file($campo)->extension();
            $data = file_get_contents($request->capa);
            return 'data:image/'.$ext.';base64,'.base64_encode($data);
        else:
            return 'data:image/jpg;base64,';
        endif;
    }

    
}
